import React from "react";

function Addbuild() {
  return (
    <div>
      <label for='Bname'>
        <b className='signTextName'>Build Name</b>
      </label>
      <input type='text' placeholder='Enter your build name' name='bname' required value={buildname} />
    </div>
  );
}

export default Addbuild;
